  console.log(props.cartItems, "cartitems");
  return (
    <div>
      {props.cartItems === 0 ? (
        "Doggo Basket is empty"
      ) : (
        <div>
          <h3>
            {" "}
            You have {props.cartItems} different{" "}
            {props.cartItems > 1 ? "doggos" : "doggo"} to pet in the
            Doggo Basket.
          </h3>
        </div>
      )}
    </div>
  );
};

export default Cart;
